import React from "react";
import "./Feature.css";

const Feature = () => {
  return (
    <>
      <section className="feature top" id="feature">
        <div className="container">
          <div className="heading">
            <h3>Projects:</h3>
            <h1>What I Do</h1>
          </div>

          <div className="content grid">
            <Card />
          </div>
        </div>
      </section>
    </>
  );
};

export default Feature;
